import React from "react";
import Opcion from "../Opcion/index";
import './style.css'


const opciones = [
    {
        nombre:"Home",
        ruta: '/'
    }, 
    {
        nombre: "Favoritos",
        ruta: "/Favoritos"
    },
    {
        nombre: "Populares",
        ruta:"/Populares"
    },
    {
        nombre: "Estrenos",
        ruta:"/Estrenos"
    }
]

function Header() {
    return(
        <nav className="header">
            <ul className="navbar">
               {
                opciones.map((elm) => <Opcion data={elm} /> )
               }
            </ul>
            <img className="logo" src="/imgs/logoPagina.jpg" alt="Logo Pagina" />
        </nav>
    )
} 

export default Header
